/* 1. Type */
/* boolean형 */
let isDone = false;
let isShow = true;
console.log(isDone);
console.log(isShow);
/* 숫자형 */
let num1 = 7;
let num2 = 0.6878;
console.log(num1);
console.log(num2);
/* 문자형 */
let str = "hello";
console.log(str);
/* 숫자형 배열의 타입을 정하는 2가지 방법 */
let list1 = [1, 2, 3];
let list2 = [1, 2, 3];
console.log(list1);
console.log(list2);
/* 문자형 배열의 타입을 정하는 2가지 방법 */
let list3 = ["banana", "apple", "mango"];
let list4 = ["banana", "apple", "mango"];
console.log(list3);
console.log(list4);
/* 튜플 */
let list5 = [1, "banana", true];
console.log(list5);
/* 객체형 타입을 정하는 2가지 방법 */
let obj = {};
let obj2 = {
  name: "kimcoding",
  age: 20,
  isDeveloper: true,
};
console.log(obj);
console.log(obj2);
